import React, { Component } from 'react';
import Slider from 'react-input-slider';
class PersonsCount extends Component {
    state = {
        x:10,
        y:20
    }
    handleChange =()=>{
        console.log('Changed');
    }
    render() {
        return(
            <div>
                ({this.state.x}, {this.state.y})
                <Slider axis="xy" x={this.state.x} y={this.state.y} onChange={this.handleChange} />
                <Slider
                  axis="x"
                  x={this.state.x}
                  onChange={({ x }) => setState(state => ({ ...this.state, x }))}
                />
                <Slider axis="y" y={this.state.y} onChange={({ y }) => setState(state => ({ ...state, y }))} />
          </div>
        )
    }
}

export default PersonsCount;
